import { useEffect, useState } from "react";

function Video() {
  const [data, setData] = useState()

  const fetchJson = () => {
    fetch('./data.json')
      .then(response => {
        return response.json();
      })
      .then(data => {
        setData(data);
      })
      .catch((e) => {
        console.log(e.message);
      });
  }
  
  useEffect(() => {
    fetchJson()
  },[])

  return(
    <>
      <div>Name : {data?.video_url}</div>
    </>
  )
}

export default Video;
